import EthLogo from "../eth_logo.svg";

const renderInputBox = () => {
  return (
    <>
      <div style={{ marginBottom: 150, marginTop: 50 }}>
        <input
          type="number"
          class="form-control"
          placeholder="Enter ETH amount"
          style={{ width: "50%", float: "left" }}
        ></input>
        <button type="button" class="btn btn-light" style={{ float: "left" }}>
          Wrap
        </button>
      </div>
      <input
        type="number"
        class="form-control"
        placeholder="Enter WETH amount"
        style={{ width: "50%", float: "left" }}
      ></input>
      <button type="button" class="btn btn-light" style={{ float: "left" }}>
        Unwrap
      </button>
    </>
  );
};

import React, { Component, useEffect, useState } from "react";

export default function Wrap({ degree, userLocation, basic }) {
  const colorScheme = useColorScheme();
  const [groundData, setGroundData] = useState();
  const [barChartData, setBarChartData] = useState([]);
  const [graphData, setGraphData] = useState([]);

  useEffect(() => {
    const fetchChartGCD = async () => {
      //For local env: Change to your own IP address, do command ifconfig to see example: 192.168.0.100:BACKEND_PORT
      const localUrl =
        "http://192.168.0.128:3008/v1/gcd?latitude=" +
        userLocation.latitude +
        "&longitude=" +
        userLocation.longitude;
      const liveUrl =
        "https://allemansbacken.newseed.se/v1/gcd?latitude=" +
        userLocation.latitude +
        "&longitude=" +
        userLocation.longitude;
      console.log(liveUrl, "liveuuurl chart");
      const res = await fetch(liveUrl);
      const data = await res.json();
      setGroundData(data);
      let categorizedData = await createCharts(data);
      setGraphData(categorizedData);
    };
    fetchChartGCD();
  }, []);

  return (
    <div class="container">
      <div class="row">
        <div class="col-5">
          <h1>
            <br></br>
            <b>Wrap here </b>
          </h1>

          {renderInputBox()}
        </div>
        <div class="col-6">
          <img src={EthLogo} style={{ width: "40%" }} />
        </div>
        <div class="col"></div>
      </div>
    </div>
  );
}

const styleSheet = StyleSheet.create({
  image: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
  },

  imageWithText: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
  },
});
